export const GET_ALBUMS = "GET_ALBUMS";
export const GET_ALBUM = "GET_ALBUM";
export const CREATE_ALBUM = "CREATE_ALBUM";
export const ADD_IMAGE = "ADD_IMAGE";
export const SHOW_DELETE_ALBUM_POPUP = "SHOW_DELETE_ALBUM_POPUP";
export const SHOW_DELETE_IMAGE_POPUP = "SHOW_DELETE_IMAGE_POPUP";
export const SHOW_IMAGE_POPUP = "SHOW_IMAGE_POPUP";
export const DELETE_ALBUM = "DELETE_ALBUM";
export const DELETE_IMAGE = "DELETE_IMAGE";
const ROOT_URL = "http://localhost:3000/api"; // get all albums

export const getAlbums = () => {
  return dispatch => {
    axios.get(`${ROOT_URL}/getAlbums`).then(res => {
      dispatch({
        type: GET_ALBUMS,
        payload: res.data
      });
    }).catch(error => {
      console.log("error", error.response);
    });
  };
}; // find album

export const findAlbum = albumId => {
  return dispatch => {
    axios.get(`${ROOT_URL}/findAlbum/${albumId}`).then(res => {
      dispatch({
        type: GET_ALBUM,
        payload: res.data
      });
    }).catch(error => {
      console.log("error", error.response);
    });
  };
}; // create album

export const createAlbum = (albumName, history) => {
  return dispatch => {
    axios.post(`${ROOT_URL}/create-album`, {
      albumName
    }).then(res => {
      dispatch({
        type: CREATE_ALBUM,
        payload: res.data
      });
      history.push("/findAlbum/" + res.data.albumId);
    }).catch(error => {
      console.log("error.response in create album", error.response);
    });
  };
}; // add images

export const addImage = (image, albumId) => {
  return dispatch => {
    axios.put(`${ROOT_URL}/add-image/${albumId}`, {
      image
    }).then(res => {
      dispatch({
        type: ADD_IMAGE,
        payload: res.data
      });
    }).catch(error => {
      console.log("error.response", error.response);
    });
  };
}; // delete album popup

export const showDeleteAlbumPopup = albumToDeleteId => {
  return {
    type: SHOW_DELETE_ALBUM_POPUP,
    payload: albumToDeleteId
  };
}; // delete image popup

export const showDeleteImagePopup = imageToDeleteId => {
  return {
    type: SHOW_DELETE_IMAGE_POPUP,
    payload: imageToDeleteId
  };
}; // show image popup

export const showImagePopup = imageToShow => {
  return {
    type: SHOW_IMAGE_POPUP,
    payload: imageToShow
  };
};
export const deleteAlbum = albumId => {
  return dispatch => {
    axios.post(`${ROOT_URL}/delete-album`, {
      albumId
    }).then(res => {
      dispatch({
        type: DELETE_ALBUM,
        payload: res.data
      });
    }).catch(error => {
      console.log("error.response", error.response);
    });
  };
};
export const deleteImage = (imageToDelete, albumId) => {
  return dispatch => {
    axios.post(`${ROOT_URL}/delete-image`, {
      imageToDelete,
      albumId
    }).then(res => {
      dispatch({
        type: DELETE_IMAGE,
        payload: res.data
      });
    }).catch(error => {
      console.log("error.response", error.response);
    });
  };
};

